        #[cfg_attr(
            any(target_arch = "aarch64", target_arch = "arm64ec"),
            link_name = "llvm.aarch64.neon.st2.v4i16.p0"
        )]
        fn _vst2_s16(a: int16x4_t, b: int16x4_t, ptr: *mut i8);
    }
